public static String trimQueueName(String name) {
  if (name == null) {
    return null;
  }
  int start = 0;
  while (start < name.length()
      && isWhitespace(name.charAt(start))
      && start < name.length()) {
    start++;
  }
  int end = name.length() - 1;
  while (end >= 0
      && isWhitespace(name.charAt(end))
      && end > start) {
    end--;
  }
  return name.substring(start, end+1);
}
